import { Box, Button, TextField, Typography } from '@mui/material'
import { useState } from 'react'

import usePostCreateShop from '@/hooks/shopping/usePostCreateShop'
import { useNavigate } from 'react-router-dom'

const ShopCreatePage = () => {
  const { mutateAsync: createShop } = usePostCreateShop()
  const [name, setName] = useState<string>('테스트상점')
  const [userId, setUserId] = useState<number>(1)
  const navigate = useNavigate()

  async function create() {
    try{
      await createShop({ userId, name })
      alert('생성 완료')
      navigate(-1)
    } catch (e) {
      alert('에러 발생', e)
    }
  }

  return (
    <Box sx={{ padding: '20px', display: 'flex', flexDirection: 'column', gap: '20px' }}>
      <Typography variant="h4">Shop Create</Typography>

      <TextField
        label="상점 이름"
        variant="outlined"
        value={name}
        onChange={(e) => setName(e.target.value)}
        fullWidth
      />

      <TextField
        label="할당 유저 ID"
        type="number"
        variant="outlined"
        value={userId}
        onChange={(e) => setUserId(Number(e.target.value))}
        fullWidth
      />

      <Button
        variant="contained"
        color="primary"
        onClick={create}>
        Create Shop
      </Button>
    </Box>
  )
}

export default ShopCreatePage
